import React, { useEffect, useState } from 'react';
import './style.css';
import * as ApiService from '../../ApiService';

function Collection() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    async function fetching() {
      let images = await ApiService.getImages();
      // console.log(images);
      setImages(images);
    }
    fetching();
  }, []);

  return <div className='collection'>Collection</div>;
}

export default Collection;
